CREATE TABLE `food_mban1` (
	`Product_id` VARCHAR(10) NOT NULL,
	`product_name` VARCHAR(255) NOT NULL,
	`product_category` VARCHAR(100) NULL,
	`product_sub_category` VARCHAR(100),
	`brand_name` VARCHAR(100),
	`regular_price` DOUBLE,
	`amount_special_diet` INT,
	`serving_size` DOUBLE,
	`measurement_serving_size` VARCHAR(100),
	`serving_per_product` DOUBLE,
	`Price_per_quantity_unit` DOUBLE,
	`date_data_retrieval` DATETIME,
	`Keto_friendly` TINYINT,
	`Paleo_friendly` TINYINT,
	`Gluten_free` TINYINT,
	`Vegetarian` TINYINT,
	`Sugarconscious` TINYINT,
	`Dairy_free` TINYINT,
	`Engine_2` TINYINT,
	`Low_sodium` TINYINT,
	`Low_fat` TINYINT,
	`Vegan` TINYINT,
	`Organic` TINYINT,
	`Whole_food_diet` TINYINT,
	PRIMARY KEY (`Product_id`)
);


